using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using Daily_Programmer._224_DetectingFourSidedFigures;

namespace DailyProgrammer.Test
{
    [TestClass]
    public class DetectingFourSidedFiguresTest
    {
        private DetectingFourSidedFigures detector;

        [TestInitialize]
        public void TestInitialize()
        {
            detector = new DetectingFourSidedFigures();
        }

        [TestMethod]
        public void SampleInput_ShouldReturn1()
        {
            var input = @"
+----+
|    |
+----+
";
            var count = detector.Count(input);
            Assert.AreEqual(1, count);
        }

        [TestMethod]
        public void SampleInput_ShouldReturn3()
        {
            var input = @"
+----+--+
|    |  |
+----+--+
";
            var count = detector.Count(input);
            Assert.AreEqual(3, count);
        }

        [TestMethod]
        public void SampleInput_ShouldReturn5()
        {
            var input = @"
+----+--+
|    |  |
+----+--+
|    |
+----+
";
            var count = detector.Count(input);
            Assert.AreEqual(5, count);
        }

        [TestMethod]
        public void SampleInput_ShouldReturn25()
        {
            var input = @"
                                +----+
                                |    |
+-------------------------+-----+----+
|                         |     |    |
|     +-------------------+-----+    |
|     |                   |     |    |
|     |                   |     |    |
+-----+-------------------+-----+    |
      |                   |     |    |
      |                   |     |    |
      +-------------------+-----+    |
                          |     |    |
                          |     |    |
                          |     |    |
                          +-----+----+
                                |    |
                                |    |
                                |    |
                                +----+
";
            var count = detector.Count(input);
            Assert.AreEqual(25, count);
        }

        [TestMethod]
        public void ChallengeInput_ShouldReturn25()
        {
            var input = @"
              +-----------+
              |           |
              |           |
              |           |
              |           |              
+-------------+-----------+-------------+
|             |           |             |
|             |           |             |
|             |           |             |
|             |           |             |
+-------------+-----------+-------------+
              |           |
              |           |
              |           |
              |           |              
+-------------+-----------+-------------+
|             |           |             |
|             |           |             |
|             |           |             |
|             |           |             |
+-------------+-----------+-------------+
              |           |
              |           |
              |           |
              |           |              
              +-----------+
";
            var count = detector.Count(input);
            Assert.AreEqual(25, count);
        }

        [TestMethod]
        public void ChallengeInput_ShouldReturn10()
        {
            var input = @"
+--++--+--+
|  ||  |  |
+--+|  +--+
+---+--+  
|+-+|+-+--+
|| ||| |  |
|+-+|+-+  |
+---+  +--+
";
            var count = detector.Count(input);
            Assert.AreEqual(10, count);
        }

        [TestMethod]
        public void ChallengeInput_ShouldReturn3()
        {
            var input = @"
    +---+
    |   |
+---+---+---+
|   |   |   |
+---+   +---+
";
            var count = detector.Count(input);
            Assert.AreEqual(3, count);
        }

        [TestMethod]
        public void ChallengeInput_ShouldReturn1()
        {
            var input = @"
++
++
";
            var count = detector.Count(input);
            Assert.AreEqual(1, count);
        }

